INSERT INTO `55web_about` (`id`, `snumber`, `title`, `description`, `memberimage`, `status`, `created_date`) VALUES
(18, 1, ' Research', 'An extensive knowhow of your core business and an insight in to your processes forms the basis of our research. Knowledge of your services, customers, target audience and competitors guides us in design development.', '1464154933.gif', 1, '2016-06-09 14:11:50'),
(24, 2, 'Define', 'Your business aspirations define our design goals. An accurate perception on the needs of your current clientele and the targeted group helps us steer your business towards a bright and rewarding future.', '1464161715.gif', 1, '2016-05-25 09:35:15'),
(25, 3, 'Finalize', 'An authentic and perfect silhouette of your website is our final product. The attractive home page, informative subpages, all-purpose mobile apps and many more functions are crafted integrating technology and creativity in the right ratio.', '1464161798.gif', 1, '2016-05-25 09:36:38'),
(26, 4, 'Code', 'Structure of the online framework of your organization is put in place by our design development team. This design takes shape in the able hands of our technology team who create the necessary coding.', '1464161894.gif', 1, '2016-05-25 09:38:14'),
(27, 5, 'Testing', 'A bona fide launch of the website and official handing over to the client takes place only after testing for the desired functionalities. A comprehensive testing of design and coding takes place in all the areas.', '1464161944.gif', 1, '2016-05-25 09:39:04'),
(28, 6, 'Launch', 'This is the phase where your dream of an effective web presence is accomplished opening up new arenas of business opportunities. Our partnership flags off from here to continue on the path of your success.', '1464162216.gif', 1, '2016-05-25 09:43:36');
