INSERT INTO `55web_brand` (`id`, `description`, `status`, `created_date`) VALUES
(1, '<p>Designing a logo is not the only element of brand identity. There is much more that comes under brand identity. A brand is a promise and a unique combination of logo, words, typefaces, colors, personality, price, customer service, voice &amp; many more. A strong brand identity delivers a clear, credible and memorable message to your customer.</p><p>55 Web follows a true methodology to create a successful corporate brands. We are very skilled at weaving the brand stories that helps to raise the bar of performance index. We have enough expertise to connect with you and implant a clear perception, credibility and loyalty to your business.</p>', 1, '2016-06-09 12:48:29');
